import Card from 'react-bootstrap/Card';

import { ListGroup, ListGroupItem } from 'react-bootstrap';


const EventList = ({ events }) => {
  return (
    events.map((eve) => (
      <Card key={eve.id} style={{ width: '18rem' }}>
        <Card.Body>
          <Card.Text>{eve.type}</Card.Text>
          <Card.Text>{eve.date}</Card.Text>
          <Card.Title>{eve.title}</Card.Title>
          <p>{eve.description}</p>

          <ListGroup className="list-group-flush">
            <ListGroupItem>Location: {eve.location}</ListGroupItem>
            <ListGroupItem>Time: {eve.time}</ListGroupItem>
          </ListGroup>

          <button>Delete</button>
        </Card.Body>
      </Card >
    ))
  );
}

export default EventList;
